Interface for all custom metadata views. This is an extension of Marionette Layout View Extends: Marionette.LayoutView Example (A new metadata view metadata.helloworld.view.js could be defined as) define([ 'd2/sdk/widgets/metadata.panel/metadata.panel.view'], function (MetadataPanelView) { 'use strict'; var helloworldViewTemplate = '<script type="text/html">' + '<h3 style="
' + ' margin-top: 48px;
' + ' padding: 16px;
' + ' font-size: 24px;
' + ' color: red;
' + '">Hello World !</h3>' + '</script>'; var MetadataHelloworldView = MetadataPanelView.extend({ template: helloworldViewTemplate }, { enabled: function () { // This metadata view will be shown or hidden based on whether // the enabled function returns true or false return true; } }); return MetadataHelloworldView;}); Example (Suppose we do not want to show this metadata view for task, workflow step, repository, folders and cabinets, we can write a simple equality check for node type using constants utils from sdk) enabled: function (options) { var nodeType = options.node && options.node.get('type'); if (nodeType === constants.Types.TASK || nodeType === constants.Types.WORKFLOW_STEP || nodeType === constants.Types.REPOSITORY || nodeType === constants.Types.FOLDER || nodeType === constants.Types.CABINET) { return false; } return true; } Example (To register this metadata view with metadata panel views array, add the entry in extension.json as) { "d2/sdk/widgets/metadata.panel/metadata.panel.views": { "extensions": { "mybundle": [ "mybundle/extensions/metadata.panel.views" ] } }} Example (The metadata.panel.views.js is defined as below. Optionally a sequence value(greater than 1000) can be passed to the metadata view entry to specify their order in the dropdown) define([ 'mybundle/widgets/metadata/panels/helloworld/metadata.helloworld.view'], function(MetadataHelloworldView){ 'use strict'; // Array of metadata views added to the plugin return [ // Each metadata view entry should have a name, title to be shown for the dropdown option // and content view to be shown on metadata panel when this view is selected // Incase multiple metadata views(panels) are added in a plugin or multiple plugins with panels are // deployed, then the order of these panels in dropdown are determined at runtime. // If panels are to be placed in specific sequence in dropdown, // then add a numeric value greater than 1000 for sequence attribute(values upto 1000 are used internally). // The panels should appear in ascending order of their sequence in dropdown { name: 'helloworld', // The metadata view name, it has to be a unique string title: 'Hello World', contentView: MetadataHelloworldView, sequence: 1010 // The sequence value determines the order in which these panels appear in the dropdown } // Additional metadata views can also be registered in this array ];}); MetadataPanelView : d2/sdk/widgets/metadata.panel/metadata.panel.view instance .options : Object .model : NodeModel static .enabled([options]) ⇒ boolean

Interface for all custom task details views. This is an extension of Marionette Layout View Extends: Marionette.LayoutView Example (A new task details view task.helloworld.view.js could be defined as) define([ 'd2/sdk/widgets/task.details.panel/task.details.panel.view'], function (TaskDetailsPanelViews) { 'use strict'; var helloworldViewTemplate = '<script type="text/html">' + '<h3 style="
' + ' padding: 16px;
' + ' font-size: 24px;
' + ' color: red;
' + '">Hello World !</h3>' + '</script>'; var TaskHelloworldView = TaskDetailsPanelViews.extend({ template: helloworldViewTemplate }, { enabled: function () { // This task details view will be shown or hidden based on whether // the enabled function returns true or false return true; } }); return TaskHelloworldView;}); Example (Suppose we want to show this task details view for only those task where assignee is dmadmin, we can write a simple equality check for node's type and assignee attributes and using constants utils from sdk) enabled: function (options) { var nodeType = options.node.get('type'), assignee = options.node && options.node.get('assignee'); if (nodeType === constants.Types.TASK && assignee === 'dmadmin') { return true; } return false; } Example (To register this task details view with task details panel views array, add the entry in extension.json as) { "d2/sdk/widgets/task.details.panel/task.details.panel.views": { "extensions": { "mybundle": [ "mybundle/extensions/task.details.panel.views" ] } }} Example (The task.details.panel.views.js is defined as below. Optionally a sequence value(greater than 1000) can be passed to the task details view entry to specify their order in the tab panel) define([ 'mybundle/widgets/task.details/panels/helloworld/task.helloworld.view'], function(TaskHelloworldView){ 'use strict'; // Array of task details views added to the plugin return [ // Each task details view entry should have a name, title to be shown for the tab // and the content view to be shown on the task details panel when this tab is selected // Incase multiple task details views(tabs) are added in a plugin or multiple plugins with tabs are // deployed, then the order of these tabs in tab panel are determined at runtime. // If tabs are to be placed in specific sequence in tab panel, // then add a numeric value greater than 1000 for sequence attribute(values upto 1000 are used internally). // The tabs should appear in ascending order of their sequence in tab panel { name: 'helloworld', // The task details tab name, it has to be a unique string title: 'Hello World', contentView: TaskHelloworldView, sequence: 1010 // The sequence value determines the order in which these tabs appear in the tab panel } // Additional task details views can also be registered in this array ];}); TaskDetailsPanelView : d2/sdk/widgets/task.details.panel/task.details.panel.view instance .options : Object .model : NodeModel static .enabled([options]) ⇒ boolean
